import Logo from "../../images/logo-light.png";

const TopPanel = () => {
  return (
    <div>
      <div className="padding-top-20px panelColor">
        </div>
        <div className="row">
          <div className="col s12 center">
            <img src={Logo} alt="Moneyview" className="logo" />
          </div>
      </div>
    </div>
  );
};

export default TopPanel;
